import { faCalendar, faCalendarAlt, faCircle, faCircleDot, faDotCircle, faLocation, faLocationDot } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import React from 'react'
import styled from 'styled-components'
import Hackathon from '../assets/hackathonImage.webp'

const Container = styled.section`
    margin-top: 5em;
    padding-top: 1em;
    padding-left: 5em;
    z-index: 2;
`



function Events() {
  return (
    <Container>


        <div>
            <div>
                <h3>Community events</h3>
                <button>Submit your Event</button>
            </div>

            <div>View Past Events</div>
        </div>
    </Container>
  )
}

export default Events
